package Lecture_1;

public class Maximum_number {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 69;
		int b = 9;
		
		if(a < b) {
			System.out.println("B is max");
		}
		if(a==b) {
			System.out.println("both equal");
		}
		else if(a>b){
			System.out.println("A is max");
		}

	}

}
